trailingComments.value:
*
 * static digit component
 * used when no easing function is set
 * @example
 * <StaticCounterDigit
 *   digit='5'
 *   height={18}
 *   radix={10}
 *   digitMap={{}}
 *   digitWrapper={(digit) => digit}
 * />

